    align-items:center;
  }
}
.flownode {
  box-sizing:border-box;
  border:1px solid#d3d4d6;
  padding:5px 10px;
  margin: 0 6px;
  border-radius:3px;
  color:#101010;
  $active-color: #1890FF;
  // $active-color: rgb(83, 168, 255);
  .el-icon-success {
    color: $active-color;
  }
  &.currentState{
    background-color: $active-color;
    border-color: $active-color;
    color:white;
  }
}

